import React, { Fragment } from 'react';
import '../styles/App.css';

const LoginButton = () => {
  const submit = () => {
    fetch('http://localhost:5000/auth/login', {
      method: 'POST',
      headers: {
        'content-type': 'application/json',
      },
      body: JSON.stringify({
        email: 'test@test.com',
        password: '123456',
      }),
    });
    const fetchUsers = () => {
      fetch('http://localhost:5000/users', {
        headers: {
          'Auth': 'application/json',
        },
        body: JSON.stringify({
          email: 'test@test.com',
          password: '123456',
        }),
      });
    };
  };
  return (
    <Fragment>
      <button onClick={submit} className='LoginButton btn btn-light mb-4'>
        Login
      </button>
      <button onClick={submit} className='LoginButton btn btn-light mb-4'>
        Fetch users
      </button>
    </Fragment>
  );
};

export default LoginButton;
